import React from 'react';
import {Fragment} from 'react';
import './styles/Main.css'
import tournament from './images/tournament.jpg'
import tutorial from './images/tutorial.jpg'
import guide from './images/guide.jpg'
import {Link} from 'react-router-dom';
import Unity, { UnityContent } from "react-unity-webgl";


function Index() {

    return (
        <Fragment>
        <div className="welcome-container">
          <h1>Physics Playground</h1>
        </div>


        <div className="container">
            <h1>What is physics playground?</h1>
            <p>
                Physics lab simulation tool built with Unity

            </p>
            <a href="./unity.html">Simulator</a>
            <Unity unityContent={new UnityContent(
    "./Build/testbuild.json",
    "./Build/UnityLoader.js"
  )} />

            <iframe src="https://i.simmer.io/@l3noire/physicsplayground" style={{width:"960px", height:"600px",border:"0"}}></iframe>


        </div>




      </Fragment>
    )
}
export default Index;
